  function randomOf() {
    var args = [],
        a = arguments;
    if (arguments.length === 1) {
      Object.keys(a[0]).forEach(function (prop) {
        args.push(a[0][prop]);
      });
    } else {
      args = arguments;
    }
    var i = Math.floor(Math.random() * args.length);
    return args[i];
  }

